import LinkButton from '../components/LinkButton';
import {Link} from 'react-router-dom';
import styles from './Home.module.css';

function Home(){
    function redirect(to){
        <Link to={to}></Link>
    }
    return(
        <section className={styles.section}>
            <h1>Bem vindo ao <span className={styles.title}>Cadastrador!</span></h1>
            <p>Escolha entre <span>Cadastrar-se</span>, para criar uma conta ou <span>Entrar</span>, caso j√° possua uma</p>
            <div>
                <div className={styles.div}>
                    <button className={styles.btn} onClick={redirect("/Entrar")}>Entrar</button>
                    {/* <LinkButton to="/Entrar" text="Entrar"/> */}
                </div>
                <div className={styles.div}>
                    <LinkButton to="/Cadastrar" text="Cadastrar"/>
                </div>
            </div>
        </section>
    )
}

export default Home;
